import React from "react";

import linkedin from "../../images/Contact/Linkedin.png";
import github from "../../images/backgroundCode/github.png";
import twitter from "../../images/Contact/Twitter.png";

const SocialContactLogo = (props) => {
  return (
    <div className="col-3 col-sm-1">
      <a href={props.source}>
        <img src={props.image} className="img-fluid" alt="logo de linkedin" />
      </a>
    </div>
  );
};

export default SocialContactLogo;
